Dramatic photos show the scene after reality TV star Renee Graziano&nbsp;was arrested for crashing her car and flipping it over while she was allegedly high on Adderall.&nbsp;&nbsp;
The 52-year-old Mob Wives star, who has reportedly battled depression&nbsp;and substance abuse, told police she’d taken Adderall earlier Tuesday, it is claimed.&nbsp;&nbsp;&nbsp;
The crash happened at 10.19pm at the intersection of Arden Avenue and Arthur Kill Road on Staten Island.&nbsp;
Driving a 2020 Nissan Murano with New Jersey plates, Graziano struck an unoccupied 2020 Jeep Wrangler.

A white man suspected of attacking and severely injuring a Black food truck owner in southeast Portland last June has pleaded guilty to an assault charge stemming from the attack, authorities said.
Daniel Thomas Warren, 40, is accused of attacking Darell Preston, who runs LoRell’s Chicken Shack and has been described as “a guy loved and respected by most and truly hated by none,” on June 15, 2023.&nbsp;
Warren pleaded guilty to a third-degree assault charge and no contest to a first-degree bias crime on Friday, according to the Multnomah County District Attorney’s Office.

A fraudster who spent £200,000 of his dead wife’s life insurance payout on luxury holidays and a hot tub with his new girlfriend has been jailed for four years.&nbsp;
Krzysztof&nbsp;Baczynski managed to gain hold of the six-figure sum, initially meant for his wife Anna Miszczuk’s son, after she died from cancer in September 2017.
Less than a month after Mrs Miszczuk’s death, Baczynski tricked her daughter, the trustee of her insurance policies, into signing the money over to him.
